INSERT INTO `game` (`id`, `name`, `editorId`, `description`, `img`, `categoryId`, `price`, `playersMin`, `playersMax`, `complexity`, `concentration`, `ambiance`) VALUES
(1, 'Monopoly', 1, 'Le but du jeu consiste à ruiner ses concurrents par des opérations immobilières. Il symbolise les aspects apparents et spectaculaires du capitalisme, les fortunes se faisant et se défaisant au fil des coups de dés. Ce jeu de société est mondialement connu, et il en existe de multiples versions. ', , 12, 25, 2, 4, 4, 3, 4);
INSERT INTO `game` (`id`, `name`, `editorId`, `description`, `img`, `categoryId`, `price`, `playersMin`, `playersMax`, `complexity`, `concentration`, `ambiance`) VALUES
(2, 'Cluedo', 1, 'Cluedo est un jeu de société dans lequel les joueurs doivent découvrir parmi eux qui est le meurtrier d\'un crime commis dans un manoir anglais, le Manoir Tudor.', , 10, 20, 2, 6, 3, 3, 4);
INSERT INTO `game` (`id`, `name`, `editorId`, `description`, `img`, `categoryId`, `price`, `playersMin`, `playersMax`, `complexity`, `concentration`, `ambiance`) VALUES
(3, 'Labyrinthe', 3, 'Sur un plateau représentant un labyrinthe, les joueurs doivent atteindre des objets dessinés sur les tuiles. La disposition des tuiles évolue à chaque tour de jeu. Le jeu se termine quand un joueur a atteint tous les objets de sa liste et est revenu à son point de départ. ', , 12, 20, 2, 4, 4, 4, 3);
INSERT INTO `game` (`id`, `name`, `editorId`, `description`, `img`, `categoryId`, `price`, `playersMin`, `playersMax`, `complexity`, `concentration`, `ambiance`) VALUES
(5, 'Mille Bornes', 2, 'Les 1000 bornes est un jeu de société utilisant des cartes spéciales sur le thème de la course automobile à ses débuts.', , 3, 26, 2, 4, 2, 2, 3);
INSERT INTO `game` (`id`, `name`, `editorId`, `description`, `img`, `categoryId`, `price`, `playersMin`, `playersMax`, `complexity`, `concentration`, `ambiance`) VALUES
(6, 'Puissance 4', 1, 'Le but du jeu est d\'aligner une suite de 4 pions de même couleur sur une grille comptant 6 rangées et 7 colonnes. Chaque joueur dispose de 21 pions d\'une couleur (par convention, en général jaune ou rouge). Tour à tour, les deux joueurs placent un pion dans la colonne de leur choix, le pion coulisse alors jusqu\'à la position la plus basse possible dans la dite colonne à la suite de quoi c\'est à l\'adversaire de jouer.', , 10, 10, 2, 2, 4, 5, 3);
INSERT INTO `game` (`id`, `name`, `editorId`, `description`, `img`, `categoryId`, `price`, `playersMin`, `playersMax`, `complexity`, `concentration`, `ambiance`) VALUES
(7, 'Docteur Maboul', 1, 'e jeu se présente sous la forme d\'une table d\'opération, avec un patient percé de cavités occupées par des éléments en plastique blanc avec des noms humoristiques. Le nez du patient est représenté sous forme d\'une ampoule rouge qui s\'allume en cas d\'échec. Le but du jeu est d\'amasser le plus d\'argent en effectuant des opérations chirurgicales. ', , 2, 30, 1, 6, 4, 4, 5);
INSERT INTO `game` (`id`, `name`, `editorId`, `description`, `img`, `categoryId`, `price`, `playersMin`, `playersMax`, `complexity`, `concentration`, `ambiance`) VALUES
(8, 'Tetris', 4, 'Tetris met le joueur au défi de réaliser des lignes complètes en déplaçant des pièces de formes différentes, les tétrominos, qui défilent depuis le haut jusqu\'au bas de l\'écran. Les lignes complétées disparaissent tout en rapportant des points et le joueur peut de nouveau remplir les cases libérées. Le jeu n\'a pas de fin : le joueur perd la partie lorsqu\'un tétromino reste bloqué en haut.', , 10, 9, 2, 4, 5, 4, 4);
INSERT INTO `game` (`id`, `name`, `editorId`, `description`, `img`, `categoryId`, `price`, `playersMin`, `playersMax`, `complexity`, `concentration`, `ambiance`) VALUES
(9, 'Uno', 5, 'Pour gagner une manche de Uno, il faut être le premier joueur à n\'avoir plus de cartes en main. Le jeu continue, manche par manche, jusqu\'à ce qu\'un joueur atteigne 500 points. ', , 6, 8, 2, 10, 3, 4, 5);
INSERT INTO `game` (`id`, `name`, `editorId`, `description`, `img`, `categoryId`, `price`, `playersMin`, `playersMax`, `complexity`, `concentration`, `ambiance`) VALUES
(10, 'Les Incollables', 3, 'Le seul jeu de quiz vraiment adapté à toute la famille ! Grâce aux 7 niveaux de difficulté (CP-CE1-CE2-CM1-CM2-Collège-Adulte), toute la famille joue à égalité de chance. Enfin un jeu de quiz où les enfants peuvent gagner contre leurs parents !2772 questions autour de 6 thèmes incontournables : Maths-Français / Animaux / Citoyenneté / Histoire / Découverte du monde / Loisirs. Mais aussi beaucoup d\'interactions entre les joueurs avec des défis, des duels, des énigmes et de la rapidité !Action, réflexion et fous rires garantis avec les Incollables !', , 9, 28, 2, 6, 4, 3, 3);
INSERT INTO `game` (`id`, `name`, `editorId`, `description`, `img`, `categoryId`, `price`, `playersMin`, `playersMax`, `complexity`, `concentration`, `ambiance`) VALUES
(11, 'Scrabble', 5, 'Le Scrabble (marque déposée) est un jeu de société et un jeu de lettres où l\'objectif est de cumuler des points, sur la base de tirages aléatoires de lettres, en créant des mots sur une grille carrée, dont certaines cases sont primées. ', , 9, 15, 2, 6, 4, 4, 3);

